import React from 'react'

class Track extends React.Component {
  constructor() {
    super()
    this.state = {
      theNode: ""
    }
  }
  handleTheState() {
    this.setState({
      theNode: "hello"
    })
  }

  render() {
    return(
      <div className="player">
        <div className="bg" onClick={this.handleTheState}>
          <div className="paused">
            <audio>
              <source src={this.props.path} type="audio/ogg" />
                Your browser does not support the audio element.
            </audio>
          </div>
        </div>
          <progress className="scrubber" value="0" max="100"></progress>
      </div>
    )
  }


}

export default Track
